import React from "react";
import { useParams } from "react-router-dom";
import io from "socket.io-client";

export default function Online({ socket }) {

    const { id } = useParams();
    console.log(id, JSON.parse(localStorage.getItem("socket")), socket, id != JSON.parse(localStorage.getItem("socket")));
    if (id != JSON.parse(localStorage.getItem("socket"))) {
        console.log('here');
        return null;
    }

    const onlineSocket = io("http://localhost:8000");
    
    onlineSocket.on("players", data => {
        console.log(data);
    });
   
    
    return (
        <div>
            <h1>Ok1</h1>
        </div>
    );
};
